// SPDX-License-Identifier: MIT
pragma solidity >=0.4.25 <0.9.0;

contract Ballot {
    struct Voter {
        uint256 weight;
        bool voted;
        uint256 vote;
    }
    struct Proposal {
        bytes32 name;
        uint256 voteCount;
    }

    address public chairman;

    mapping(address => Voter) public voters;

    Proposal[] public proposals;

    constructor(bytes32[] memory proposalName) {
        chairman = msg.sender;
        voters[chairman].weight = 1;
        for (uint256 i = 0; i < proposalName.length; i++) {
            proposals.push(Proposal({name: proposalName[i], voteCount: 0}));
        }
    }

    function giveRightToVoter(address voter) public {
        require(msg.sender == chairman, "Caller is not valid");
        require(!voters[voter].voted, "The voter already voted");
        require(voters[voter].weight == 0);
        voters[voter].weight = 1;
    }

    function vote(uint256 voteIndex)
        public
        returns (uint256 _vote, bool voted)
    {
        Voter storage sender = voters[msg.sender];
        require(sender.weight != 0, "Has no right to vote.");
        require(!sender.voted, "Already Voted");
        sender.voted = true;
        sender.vote = voteIndex;
        proposals[voteIndex].voteCount += sender.weight;
        return (sender.vote, sender.voted);
    }

    function winningPoropsal() public view returns (uint256 nameIndex) {
        uint256 winningVoteCount = 0;
        for (uint256 p = 0; p < proposals.length; p++) {
            if (proposals[p].voteCount > winningVoteCount) {
                winningVoteCount = proposals[p].voteCount;
                nameIndex = p;
            }
        }
    }

    function winnerName() public view returns (bytes32 name) {
        name = proposals[winningPoropsal()].name;
    }
}
